<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Framify Image Carousel</title>
    <link rel="stylesheet" href="/style.e308ff8e.css">
  <script src="/style.e308ff8e.js"></script></head>
  <body>
    <div class="container">
      <div class="framify-container" data-interval="1800" data-playback="">
        <div class="framify-buttons-wrapper">
          <button class="framify-button-previous">
            <img src="https://cdnjs.cloudflare.com/ajax/libs/open-iconic/1.1.1/svg/media-step-backward.svg" alt="previous">
          </button>
          <button class="framify-button-play">
            <img src="https://cdnjs.cloudflare.com/ajax/libs/open-iconic/1.1.1/svg/media-play.svg" alt="play">
          </button>
          <button class="framify-button-pause framify-button-hidden">
            <img src="https://cdnjs.cloudflare.com/ajax/libs/open-iconic/1.1.1/svg/media-pause.svg" alt="pause">
          </button>
          <button class="framify-button-next">
            <img src="https://cdnjs.cloudflare.com/ajax/libs/open-iconic/1.1.1/svg/media-step-forward.svg" alt="next">
          </button>
        </div>
        <div class="framify-elements-wrapper">
          <div class="framify-element">
            <img src="/apricots-2523272_1280.1adf0491.jpg" alt="Apricots sample image">
          </div>
          <div class="framify-element">
            <img src="/dragon-fruit-2121292_1280.517ce358.jpg" alt="Dragon fruit sample image">
          </div>
          <div class="framify-element">
            <img src="/figs-1620590_1280.a619128a.jpg" alt="Figs sample image">
          </div>
          <div class="framify-element">
            <img src="/lime-2133091_1280.d7dce5b0.jpg" alt="Lime sample image">
          </div>
          <div class="framify-element">
            <img src="/peach-2573836_1280.b05b8f55.jpg" alt="Peaches sample image">
          </div>
          <div class="framify-element">
            <img src="/pineapple-636562_1280.0908ecf8.jpg" alt="Pineapple sample image">
          </div>
          <div class="framify-element">
            <img src="/pomegranate-3383814_1280.2cf12b3b.jpg" alt="Pomegranates sample image">
          </div>
          <div class="framify-element">
            <img src="/strawberry-2960533_1280.ddda5d56.jpg" alt="Strawberries sample image">
          </div>
          <div class="framify-element">
            <img src="/tangerines-1721590_1280.786c855b.jpg" alt="Tangerines sample image">
          </div>
          <div class="framify-element">
            <img src="/watermelons-961128_1280.2168bbea.jpg" alt="Watermelons sample image">
          </div>
        </div>
      </div>
    </div>
    <script src="/script.75da7f30.js"></script>
  </body>
</html>
